        if args.fp16:
          torch.nn.utils.clip_grad_norm_(amp.master_params(optimizer), args.max_grad_norm)
        else:
          torch.nn.utils.clip_grad_norm_(model.parameters(), args.max_grad_norm)
        nb_tr_steps += 1
        optimizer.step()
        scheduler.step()
        model.zero_grad()
        global_step += 1

